import React from 'react'
import "./profileMain.css"


const ProfileMain = ({ name, job, about}) => {

  return (
    <div className='rectangle210'>
      <div className="ellipse20">
        <img src="https://media.cnn.com/api/v1/images/stellar/prod/221202150632-kanye-west-file.jpg?c=original" alt="profileName" />
      </div>
    </div>
  )
}

export default ProfileMain
